'use strict';
let string_map = require('@gehtsoft/LuaxStdlib-node').string_map;
let StringValueObject = require('./StringValueObject.js');
class InstrumentUpdatesStorage {
    storage;
    constructor() {
        this.storage = new string_map();
    }
    addSymbols(symbols) {
        let i;
        for (i = 0; i <= symbols.length - 1; i += 1) {
            this.storage.set(symbols[i], StringValueObject.create(symbols[i]));
        }
    }
    removeSymbol(symbol) {
        if (this.storage.contains(symbol)) {
            this.storage.remove(symbol);
        }
    }
    removeSymbols(symbols) {
        let i;
        for (i = 0; i <= symbols.length - 1; i += 1) {
            if (this.storage.contains(symbols[i])) {
                this.storage.remove(symbols[i]);
            }
        }
    }
    hasSymbol(symbol) {
        return this.storage.contains(symbol);
    }
}
module.exports = InstrumentUpdatesStorage
